import React from 'react';
import Expenses from './Expenses';
import Incomes from './Incomes';
import Categories from './Categories';

const Transactions: React.FC = () => {
  return (
    <div>
      <h1>Transactions</h1>
      <Categories />
      <Expenses />
      <Incomes />
    </div>
  );
};

export default Transactions;
